import React, {useState} from 'react';
import { useParams } from 'react-router-dom';
import '../../styles/review.scss';
import Header from '../../components/header';
import Menu from '../../components/hamburgerButton';
import SideBarColaborador from '../../components/sidebarColaborador';
import axios from 'axios';

function Review() {

  var { id } = useParams();

  var [feedBack, setFeedBack] = useState();

  var [input, setInput] = useState();

  const avaliaPost = (e) => {
    e.preventDefault();

    axios.post("http://localhost:3002/avaliacao/" + id, {
      headers: {
        accessToken: localStorage.getItem("accessToken"),
    },
    }).then((result) => {

    })
  }

  return (
    <>
      <Menu />
      <Header />
      <SideBarColaborador />

      <div id="main-container">
        <div id="review-container">
          <div id="review-title">
            <h3>Avaliação de Reprografia</h3>
          </div>

          <div id="review-content">
            <div id="feedback-radio">
              <div className="radio">
                <label for="nao-atendeu">Atendeu</label>
                <input
                  type="radio"
                  name="radio-option"
                  id="nao-atendeu"
                  className="checkbox-avaliacao"
                  value="Atendeu"
                />
              </div>



              <div className="radio">
                <label for="superou">Não Atendeu</label>
                <input
                  type="radio"
                  name="radio-option"
                  id="superou"
                  className="checkbox-avaliacao"
                  value="Não Atendeu"
                />
              </div>
            </div>

            <div id="feedback-text">
              <textarea placeholder=" digite seu feedback" value={feedBack}></textarea>
            </div>
          </div>
          <div id="button-review">
            <button id="review-button" type="submit"> Enviar Avaliação</button>
          </div>
        </div>
      </div>
    </>
  );
}

export default Review;
